import React from 'react'
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import NavbarTitle from "./Nav/Navbar" 
import Login from  "./Login"
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";





const BeforeLogin = ({setSession})=>{
    return<div>
      <NavbarTitle/>
      
      <Router>
          <Route setSession={setSession} exact path="/" component={Login}/>
          
          {/* <Route path="/signIn" component={TaskLogined}/> */}
      </Router>
    </div>;
}
export default BeforeLogin;
